import Modal from "../../UI/Modal";
import classes from "./Cart.module.css";



const Cart = props =>{
    const carItems = <ul className = {classes['cart-items']}>{[{id:'c1',name:'Vegan Sushi',amount:2,price:12.99},].map((item) =><li>{item.name}</li>)}</ul>
return (
    <Modal>
        {carItems}
        <div className ={classes.total}>
            <span>Total Amount</span>
            <span>36.12</span>
        </div>
        <div className = {classes.actions}>
            <button className = {classes['button--aly']}>close</button>
            <button className = {classes.button} onClick = {props.onConfirm}>Order</button>
        </div>
    </Modal>
);
    
};

export default Cart;
